const NavBar = () => {
  return (
    <nav>
      <a>Home</a>
      <a>Meal type</a>
      <a>Shopping List</a>
      <a>Favourites</a>
      <i className="fa fa-search">Camera</i>
      <input placeholder="Search Recipes"></input>
    </nav>
  );
};

export default NavBar;
